bject\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    results = []\n    for i in range(25):\n        \n        cpt = np.sum(gt[i])\n\n        s = client.persist(cpt, release=True)\n\n        results.append(client.compute(s))\n\n    del gt\n\n# Write the results\nwith open(\"results.log\", \"a\") as f:\n    result = [cpt.result() for cpt in results]\n    f.write(str(result))\n\nprint(\"{:&lt;21}\".format(\"EST_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1023","type":"ResetTool"},{"attributes":{"line_alpha":0.1,"line_color":"red","x":{"field":"time"},"y":{"field":"read_bytes"}},"id":"1309","type":"Line"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1322"},{"id":"1323"},{"id":"1324"},{"id":"1325"},{"id":"1326"},{"id":"1327"},{"id":"1328"},{"id":"1329"},{"id":"1330"},{"id":"1331"},{"id":"1332"},{"id":"1333"}]},"id":"1293","type":"DatetimeTicker"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"source":{"id":"1213"}},"id":"1312","type":"CDSView"},{"attributes":{"dimensions":"width"},"id":"1269","type":"WheelZoomTool"},{"attributes":{},"id":"1454","type":"CategoricalTickFormatter"},{"attributes":{"child":{"id":"1003"},"title":"Worker Profile (compute)"},"id":"1403","type":"Panel"},{"attributes":{},"id":"1482","type":"AllLabels"},{"attributes":{"fill_color":{"field":"bandwidth","transform":{"id":"1151"}},"hatch_color":{"field":"bandwidth","transform":{"id":"1151"}},"height":{"value":1},"line_color
